description:
Album Info

Correcting the big mistake they made last time out, the TVT label seeks out some up-to-the- minute hits for Vol. 2 of their Crunk Hits series and grabs bangers like Lil Jon's &quot;Snap Yo Fingers&quot; and the remix of Pitbull's &quot;Bojangles&quot;; cuts that were still poppin' when the collection landed on the shelves in summer 2006. Bubba Sparxxx's &quot;Ms. New Booty&quot; and Lil Wayne's &quot;Fireman&quot; weren't that old, either, and E-40's &quot;Tell Me When to Go&quot; had just made the rounds, although Bay Area residents might be ticked that the totally hyphy track ended up on a crunk collection. Regardless, it would be a shame to say you care about Southern club music and don't have Three 6 Mafia's &quot;Stay Fly,&quot; Mike Jones' &quot;Back Then,&quot; and the remix of Daddy Yankee's &quot;Gasolina&quot; in your collection. The filler is better than usual and the flow is smooth so ignore the boring cover art and get mostly crunk plus a little hyphy with this satisfying comp. 

